import './App.css';
import Navigation from './components/Navigation';

function App() {
  return (
    <>
      <Navigation />
      <div className='content'>
        <section>
          <div className='header'>
            <div className='left'>
              <p>Hey, I am</p>
              <h1></h1>
            </div>
          </div>
        </section>
      </div>
    </>
  )

}

export default App;
